import React from "react";
import Post from './Post';

function PostList({posts}){
    return (
        <div>
            <h1>Hello from PostList.js</h1>
            {
                posts.map(post => (
                    <Post post={post}/>
                ))
            }
        </div>
    )
}

export default PostList;
